import React from 'react'

const Card = ({user}) => {
    return (
        <div>
            <img src={'https://robohash.org/{user.id}set_set2/?size=500x500'}/>
            <h2>{user.name}</h2>
            <p>Nickname: {user.username}</p>
        </div>
    )
}

export default Card
